import React, { useEffect, useState } from 'react'
import axios from 'axios'

const Dogs = () => {
  const [dogs, setDogs] = useState([])
  const [ready, setReady] = useState(false)
  const DOGS_URL = `https://dog.ceo/api/breed/hound/images/random/12`

  useEffect(() => {
    const getDogs = async (url) => {
      const res = await axios.get(DOGS_URL)
      setDogs(res.data.message)
    }

    getDogs(DOGS_URL)
  }, [])

  return (
    <div>
      {
        dogs.length > 0 && dogs.map(dog => {
          return <img src={dog} />
        })
      }
    </div>
  )
}

export default Dogs
